import React, { Component } from "react";
import Button from "react-bootstrap/Button";
import Incorrectinfo from "../incorrect-info";

class Activitydetails extends Component {
  render() {
    return (
      <>
        <div className="chat-thread-left">
          <p>Do the details of activity points looks correct to you?</p>
          <div className="button-wrapper">
            <Button>No</Button>
            <Button>Yes</Button>
          </div>
        </div>
        <Incorrectinfo
          option={[
            {
              firstOption: "Activity Points are incorrect",
            },
            {
              firstOption: "Have not received the payout",
            },
            {
              firstOption: "First Option",
            },
            {
              firstOption: "First Option",
            },
          ]}
        />
      </>
    );
  }
}

export default Activitydetails;
